import React from 'react';
import { PageTitle } from 'Shared/InputComponents';

export default class Description extends React.Component {
  render() {
    return (
      <>
        <PageTitle title="Page 1: Contact Us" ></PageTitle>

        <p>Please complete the form below if you would like to contact us about any aspect of the website. We always try to respond quickly (mostly within 5 working days). We welcome your feedback and your suggestions for improving the site to make it more helpful for young people and all those who support them.</p>
      </>
    );
  }
}
